import React from 'react';
import { NavLink }  from 'react-router-dom';

const SignedInLinks = () => {
  return (
    <ul className="right">
        <li><NavLink to='/'> Conact </NavLink> </li>
        <li><NavLink to='/'> log in </NavLink> </li>
        <li><NavLink to='/'> log out </NavLink> </li>
        </ul>
  )
}

export default SignedInLinks;
